<html>

<head>
<meta name="GENERATOR" content="Microsoft FrontPage 4.0">
<title>Image Cutter Output File</title>
<link rel="stylesheet" type="text/css" href="custom.css">
</head>

<body topmargin="0" bgcolor="#000000">
<div align="center">
  <center>
<table border="0" cellspacing="0" cellpadding="0" height="119" width="780">
  <tr>
    <td height="60" width="780" background="banner1.gif" valign="middle" align="center">
      <p class="logoline">#LOGO#</p>
    </td>
  </tr>
  <tr>
    <td height="59" width="780"><img src="banner2.gif" height="59" width="780" border="0"></td>
  </tr>
</table>
  </center>
</div>
<div align="center">
  <center>
  <table border="0" cellpadding="0" cellspacing="0" width="780">
    <tr>
      <td valign="top" align="left" width="145">#VMENU#</td>
      <td valign="top" align="left" width="470">
        <div align="center">
          <table border="0" cellpadding="4" valign="top" align="left" cellspacing="0" width="100%">
            <tr>
              <td width="100%" valign="top" align="left">
                <p class="sohotext">#CONTENT#</td>
            </tr>
          </table>
        </div>
      </td>
      <td valign="top" align="left" width="165">
        <div align="center">
          <table border="0" cellpadding="0" cellspacing="0" width="165%">
            <tr>
              <td width="165">
                <p align="center"><img border="0" src="userimages/_userimg-varphoto6.jpg" align="right" width="86" height="85"></td>
            </tr>
            <tr>
              <td width="100%">
                <p class="boxcontent1">#BOX1#</td>
            </tr>
            <tr>
              <td width="100%"><img border="0" src="userimages/_userimg-varphoto1.jpg" width="86" height="85"></td>
            </tr>
          </table>
        </div>
      </td>
    </tr>
  </table>
  </center>
</div>
<div align="center">
  <center>
  <table border="0" cellpadding="0" cellspacing="0" width="780">
    <tr>
      <td height="22" bgcolor="#00FF33" valign="middle" align="center">
        <p class="SMtext"><font color="#000000">#COPYRIGHT#</font></td>
    </tr>
  </table>
  </center>
</div>
<p class="SMtext"><font color="#FFFFFF">#CUSTOMINC#</font></p>
</body>
</html>
